import React from 'react';
import data from '../data';

function getData() {
	data.fetchStreams();
	data.getStreams();
}



const Streams = () => {
  return (
    <div>
      <h1>Streams Page</h1>
    	{getData()}
    </div>
  );
};

export default Streams;
